  - name: TEXT4000
    number: '6'
    value: This report is being amended to include 2 reimbursement memo entries which
      were previously omitted from schedule H4 as well as to clarify the requested
      descriptions on Schedules A & B.  The disbursements described as FEA Payment
      of Debt and Payment on Debt have been amended to reflect the purpose of the
      original obligation as previously reported.  All disbursements for FEA GOTV
      - GENERIC PHONE CALLS and FEA GOTV - GENERIC CALL LISTS were for costs associated
      with a Party Get-Out-The-Vote activity [as defined by 11 CFR 100.24(b)(2)] designed
      to encourage the general public to vote and did not mention any federal candidate
      or candidate committee.  All disbursements and expenditures for FEA Candidate
      Collateral Material, FEA EXEMPT/BROCHURES, and FEA EXEMPT/BROCHURE PRINTING
      were for materials (Yard Signs, Hand Brochures, Bumper Stickers) used in exempt
      party activities driven by volunteer efforts and meet the conditions of exempt
      party activity as defined by 11 CFR 100.87 and according to the code need not
      be allocated in committee reports to specific candidates (11 CFR 100.87(e).   All
      disbursements and expenditures for FEA EXEMPT/SLATE CARDS were for the printing
      and mailing of slate cards which meet the definition of slate cards as defined
      by 11 CFR 100.80 and according to the same section need not be allocated in
      committee reports to specific candidates.   All disbursements and expenditures
      for NEGOP FUNRAISING EVENT EXPENSE, and TELEMARKETING - NEGOP were for fundraising
      purposes for the state party only; no federal candidate or federal officeholder
      was identified in any of these events.  Non-federal funds were not used in connection
      with any federal election or federal election activity.
